import React from 'react';
import { TextInput, StyleSheet } from 'react-native';

const Input = props => {
  return <TextInput
   style={styles.input}
   placeholder={props.placeholder}
   blurOnSubmit
   autoCapitalize={false}
   keyboardAppearance/>;
};

const styles = StyleSheet.create({
  input: {
    height: 30,
    borderBottomColor: 'grey',
    borderBottomWidth: 1,
    marginVertical: 10,
    width: 50,
    textAlign: 'center'
  }
});

export default Input;
